INSERT INTO `problem` VALUES (1,NULL,'Заполните все пустые клетки таблицы; в названиях укажите ударение.\\\\\n\\begin{tabularx}{\\linewidth}{|X|X|X|X|X|X|}\\hline\nСтрочная\\newline буква & Прописная\\newline буква & Название & Строчная\\newline буква & Прописная\\newline буква & Название\\\\\\hline\n$\\omega$ & & &  & $H$ & \\\\\\hline\n$\\iota$ & & &  & $Z$ & \\\\\\hline\n$\\xi$ & & &  & $T$ & \\\\\\hline\n\\end{tabularx}',NULL,NULL,NULL,NULL,'1','49',NULL),(2,NULL,'Приведите пример теоремы, которая является критерием и теоремы, которая критерием не является (требуются полные формулировки теорем, необязательно из курса ДС).',NULL,NULL,NULL,NULL,'2','55',NULL),(3,NULL,'Сформулируйте определение отношения эквивалентности.\n\n',NULL,NULL,NULL,NULL,'3','78',NULL),(4,NULL,'Запишите, что есть посылка и что есть заключение в теореме о сумме геометрической прогрессии.\n\n',NULL,NULL,NULL,NULL,'4','59',NULL),(5,NULL,'Сформулируйте обратное утверждение к утверждению принципа Дирихле. Заметьте, что вполне можно сформулировать это обратное утверждение, хотя оно и будет неверным в общем случае.\n\n',NULL,NULL,NULL,NULL,'5','44',NULL),(6,NULL,'Докажите методом математической индукции, что для любого натурального $n$ из квадрата размера $2^n\\times 2^n$ на клетчатой бумаге можно вырезать одну клетку, так, что оставшиеся клетки можно замостить уголками $2\\times 2$ (т.е. $2\\times 2$-квадратиками с одной вырезанной клеткой).\n\n',NULL,NULL,NULL,NULL,'6','50',NULL),(7,NULL,'Докажите теорему Дирихле о приближении иррациональных чисел рациональными: для любого иррационального $\\alpha\\in (0,1)$ и любого $N\\in\\bbN$ существуют такие целые числа $a,b\\in[0,n]$, для которых $\\left|\\frac{a}{b}-\\alpha\\right|<\\frac{1}{nb}$. Иными словами, дробь $\\frac{a}{b}$ «хорошо приближает» число $\\alpha$.\n\n\n',NULL,NULL,NULL,NULL,'7','47',NULL),(8,NULL,'Докажите методом математической индукции, что любой набор из $n,\\,n\\in\\bbN,$ прямых на плоскости, никакие три из которых попарно не параллельны и не пересекаются в одной точке, разбивают плоскость на $(n^2+n+2)/2$ областей.\n\n',NULL,NULL,NULL,NULL,'8','50',NULL),(9,NULL,'Докажите, что среди любых $n$ натуральных чисел найдется поднабор, сумма чисел которого делится на $n$.\n\n\n',NULL,NULL,NULL,NULL,'9','47',NULL),(10,NULL,'В некоторой стране из каждого города выходит нечётное число дорог. На центральной площади каждого города поднят чёрный или белый флаг. Каждое утро в одном (\\emph{ровно} в одном) из городов, у которого число соседей с флагами другого цвета строго больше половины, меняют цвет флага. Может ли этот процесс продолжаться бесконечно?\n\n',NULL,NULL,NULL,NULL,'10','48',NULL),(11,NULL,'На плоскости выбрано конечное число точек. Некоторые из выбранных точек соединены отрезками. Если два отрезка пересекаются, то их можно заменить двумя другими с концами в тех же точках. Может ли этот процесс продолжаться бесконечно?\n\n',NULL,NULL,NULL,NULL,'11','48',NULL),(12,NULL,'Сколько четырехзначных чисел, делящихся на 4, можно составить из цифр 1, 2, 3, 4, 5, если каждая цифра может встречаться несколько раз?\n\n',NULL,NULL,NULL,NULL,'12','86',NULL),(13,NULL,'Сколькими способами можно в течение трёх дней выбирать по 6 участников из хора в 10 человек так, чтобы каждый день состав хора был разным?\n\n\n',NULL,NULL,NULL,NULL,'13','86',NULL),(14,NULL,'Запишите, что есть посылка и что есть заключение в основной теореме арифметики.\n\n',NULL,NULL,NULL,NULL,'14','59',NULL),(15,NULL,'На потоке второго курса ПМФ ФИВТ три группы. Преподаватели узнали, что каждый второкурсник ПМФ всегда даёт списывать ровно одному своему коллеге (всегда одному и тому же). Докажите, что деканат может заново перераспределить студентов по трём группам, так, что в каждой отдельной группе не окажется ни одной пары студентов, из которых один даёт списывать другому. (Перераспределяйте шаг за шагом, так, чтобы каждый шаг приводил к улучшению ситуации. Чётко опишите, где в вашем решении «потенциал».)\n\n\n',NULL,NULL,NULL,NULL,'15','48',NULL),(16,NULL,'Докажите, что из любых $52$ чисел всегда можно выбрать два, сумма или разность которых делится на $100$.\n\n\n',NULL,NULL,NULL,NULL,'16','47',NULL),(17,NULL,'Докажите, что если число $x+1/x$ целое, то $x^n+1/x^n$ — тоже целое для любого $n\\in\\bbN$.\n\n\n',NULL,NULL,NULL,NULL,'17','50',NULL),(18,NULL,'Сколькими разными способами можно расставить $30$ томов на книжной полке, чтобы тома $3$ и $4$ рядом не стояли?\n\n\n',NULL,NULL,NULL,NULL,'18','86',NULL),(19,NULL,'Имеется $2n$ букв, среди которых каждая буква повторяется ровно два раза. Найдите число различных $2n$-буквенных слов, которые можно составить из этих букв, так, чтобы было \\emph{ровно} две пары стоящих рядом одинаковых букв. Например, для набора букв $\\{A,A,B,B,C,C,D,D\\}$ допустимым будет слово $ABBCADDC$ (в нём идут подряд пары букв $B$ и $D$). В ответе разрешается использовать любые известные вам комбинаторные числа, а также суммы.\n\n\n',NULL,NULL,NULL,NULL,'19','77',NULL),(20,NULL,'Сколькими способами можно распределить $r$ различных книг между $(m+n)$ лицами, среди которых $m$ отличников и $n$ двоечников, так, чтобы \\emph{ровно} три (любых, не фиксированных) двоечника не получили книг, а все остальные ученики получили хотя бы по одной книге? Считайте, что $r>m+n$. В ответе разрешается использовать любые известные вам комбинаторные числа, а также суммы.\n\n\n',NULL,NULL,NULL,NULL,'20','77',NULL),(21,NULL,'Вычислите сумму биномиальных коэффициентов $\\binom{n}{2}+2\\binom{n}{3}+3\\binom{n}{4}+\\ldots+(n-1)\\binom{n}{n}$.\n\n\n',NULL,NULL,NULL,NULL,'21','81',NULL),(22,NULL,'Вычислите сумму биномиальных коэффициентов $\\binom{n}{0}+3\\binom{n}{1}+5\\binom{n}{2}+\\ldots+(2n+1)\\binom{n}{n}$.\n\n\n',NULL,NULL,NULL,NULL,'22','81',NULL),(23,NULL,'Вычислите сумму биномиальных коэффициентов $3\\binom{n}{1}+7\\binom{n}{2}+11\\binom{n}{3}+\\ldots+(4n-1)\\binom{n}{n}$.\n\n\n',NULL,NULL,NULL,NULL,'23','81',NULL),(24,NULL,'Для \\emph{произвольных} $k,m,n\\in\\bbN$ найдите количество независимых множеств размера $k$ в графе $K_{m,n}$. Никаких условий на соотношения между $k,m,n$ по умолчанию нет.\n\n\n',NULL,NULL,NULL,NULL,'24','62',NULL),(25,NULL,'%Было GRAPH_COUNTING, оказалось копией 24-й задачи\nДля \\emph{произвольных} $k,m,n\\in\\bbN$ найдите количество независимых множеств размера $k$ в графе $K_{m,n}$. Никаких условий на соотношения между $k,m,n$ по умолчанию нет.\n\n\n',NULL,NULL,NULL,NULL,'25','None',NULL),(26,NULL,'Сколько разных полных двудольных графов можно соорудить на множестве вершин $\\{1,\\,2,\\,\\ldots,\\,n\\}$?\n\n\n',NULL,NULL,NULL,NULL,'26','62',NULL),(27,NULL,'Сколькими способами можно выбрать $4$ разномастных карты из колоды в $36$ карт, так, чтобы среди вынутых карт оказались хотя бы два валета и ровно один король? Можно дать ответ в виде формулы, не доводя до числа. Способы, отличающиеся только порядком вынимаемых карт, считаются одинаковыми.\n\n\n',NULL,NULL,NULL,NULL,'27','86',NULL),(28,NULL,'Сколько четырёхзначных чисел можно составить, используя набор карточек \\fbox{1}, \\fbox{5}, \\fbox{1}, \\fbox{2}, \\fbox{3}, \\fbox{3}?\n\n\n',NULL,NULL,NULL,NULL,'28','86',NULL),(29,NULL,'Докажите, что если в круг единичного радиуса бросить $4$ точки, то найдутся две точки на расстоянии не больше $\\sqrt{3}$.\n\n\n',NULL,NULL,NULL,NULL,'29','47',NULL),(30,NULL,'Для \\emph{произвольных} $k,m,n\\in\\bbN$ найдите количество независимых множеств размера $k$ в графе $K_{m,n}$. Никаких условий на соотношения между $k,m,n$ по умолчанию нет.\n\n\n',NULL,NULL,NULL,NULL,'30','62',NULL),(31,NULL,'Сколькими способами можно расселить $20$ туристов по $5$ домикам, чтобы ни один домик не оказался пустым? Все туристы и домики различны. Способы расселения, отличающиеся только перестановкой туристов, заселённых в один домик, считаются одинаковыми.\n\n\n',NULL,NULL,NULL,NULL,'31','86',NULL),(32,NULL,'Приведите пример графа на $2015$ вершинах, у которого ровно $1147$ центральных вершин.\n\n\n',NULL,NULL,NULL,NULL,'32','68',NULL),(33,NULL,'Докажите, что если в графе на $n$ вершинах больше чем $\\binom{n-1}{2}$ рёбер, то граф связен.\n\n\n',NULL,NULL,NULL,NULL,'33','71',NULL),(34,NULL,'Постройте пример связного графа на $56$ вершинах, у которого кликовое число равно $7$, а число независимости равно $8$.\n\n\n',NULL,NULL,NULL,NULL,'34','82',NULL),(35,NULL,'Сколько есть слов (произвольных последовательностей букв) длины $20$ в алфавите английского языка, которые не содержат подслово \\emph{forbidden}, но обязательно содержат подслово \\emph{required}? Для справки: в алфавите английского языка $26$ букв.\n\n\n',NULL,NULL,NULL,NULL,'35','86',NULL),(36,NULL,'Являются ли графы на рисунке изоморфными? Если да, приведите изоморфизм, если нет, докажите.\n\\[\\begin{tikzpicture}[scale=0.7]\n\\node (p1) at (0,0) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\node (p2) at (1,0) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\node (p3) at (1.5,0.86) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\node (p4) at (1,1.73) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\node (p5) at (0,1.73) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\node (p6) at (-0.5,0.86) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\node (p7) at (0,0.86) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\node (p8) at (1,0.86) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\draw (p1) -- (p2) -- (p3) -- (p4) -- (p5) -- (p6) -- (p1);\n\\draw (p1) -- (p7) -- (p8) -- (p2);\n\\draw (p6) to [bend left=45] (p3);\n\\node (p9) at (3.5,0) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\node (p10) at (4.5,1) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\node (p11) at (3.5,2) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\node (p12) at (2.5,1) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\node (p13) at (3.5,0.5) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\node (p14) at (4,1) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\node (p15) at (3.5,1.5) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\node (p16) at (3,1) [scale=0.3,shape=circle,draw=black,fill=white] {};\n\\draw (p9) -- (p10) -- (p11) -- (p12) -- (p9);\n\\draw (p13) -- (p14) -- (p15) -- (p16) -- (p13);\n\\draw (p9) -- (p13);\n\\draw (p11) -- (p15);\n\\end{tikzpicture}\\]\n\n',NULL,NULL,NULL,NULL,'36','45',NULL),(37,NULL,'Установите соответствие (не обязательно биекцию) между деревьями на рисунке и кодами Прюфера.\n\\[\\begin{tikzpicture}[scale=0.5]\n\\node (p1) at (0,3) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$1$}] {};\n\\node (p2) at (0,0) [scale=0.3,shape=circle,draw=black,fill=white,label=-90:\\tiny{$2$}] {};\n\\node (p3) at (-2,3) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$3$}] {};\n\\node (p4) at (-1,2) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$4$}] {};\n\\node (p5) at (0,2) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$5$}] {};\n\\node (p6) at (-1,1) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$6$}] {};\n\\node (p7) at (1,2) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$7$}] {};\n\\node (p8) at (2,2) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$8$}] {};\n\\node (p9) at (1,1) [scale=0.3,shape=circle,draw=black,fill=white,label=-45:\\tiny{$9$}] {};\n\\node (p10) at (0,1) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$10$}] {};\n\\draw (p2) -- (p6) -- (p4) -- (p3);\n\\draw (p4) -- (p1);\n\\draw (p6) -- (p5);\n\\draw (p6) -- (p7);\n\\draw (p2) -- (p10);\n\\draw (p2) -- (p9) -- (p8);\n\\draw (0,-0.8) node {\\emph{\\tiny{$(a)$}}};\n\\node (p11) at (4,3) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$1$}] {};\n\\node (p12) at (5,0) [scale=0.3,shape=circle,draw=black,fill=white,label=-90:\\tiny{$2$}] {};\n\\node (p13) at (3,3) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$3$}] {};\n\\node (p14) at (3,2) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$4$}] {};\n\\node (p15) at (5,2) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$5$}] {};\n\\node (p16) at (4,1) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$6$}] {};\n\\node (p17) at (6,3) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$7$}] {};\n\\node (p18) at (6,1) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$8$}] {};\n\\node (p19) at (5,1) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$9$}] {};\n\\node (p20) at (6,2) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$10$}] {};\n\\draw (p12) -- (p16) -- (p14) -- (p13);\n\\draw (p14) -- (p11);\n\\draw (p16) -- (p15) -- (p17);\n\\draw (p12) -- (p19);\n\\draw (p12) -- (p18) -- (p20);\n\\draw (4.5,-0.8) node {\\emph{\\tiny{$(b)$}}};\n\\node (p21) at (8,3.5) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$1$}] {};\n\\node (p22) at (9,0) [scale=0.3,shape=circle,draw=black,fill=white,label=-90:\\tiny{$2$}] {};\n\\node (p23) at (8,2) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$3$}] {};\n\\node (p24) at (9,3) [scale=0.3,shape=circle,draw=black,fill=white,label=-45:\\tiny{$4$}] {};\n\\node (p25) at (9,2) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$5$}] {};\n\\node (p26) at (8,1) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$6$}] {};\n\\node (p27) at (10,3.5) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$7$}] {};\n\\node (p28) at (10,2) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$8$}] {};\n\\node (p29) at (10,1) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$9$}] {};\n\\node (p30) at (9,1) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$10$}] {};\n\\draw (p22) -- (p26) -- (p23);\n\\draw (p22) -- (p30);\n\\draw (p26) -- (p25) -- (p24) -- (p21);\n\\draw (p24) -- (p27);\n\\draw (p22) -- (p29) -- (p28);\n\\draw (9,-0.8) node {\\emph{\\tiny{$(c)$}}};\n\\end{tikzpicture}\\]\n\\begin{enumerate}\n\\item[(a)] (4,6,4,5,6,2,9,2);\n\\item[(b)] (4,4,6,6,6,2,9,2);\n\\item[(c)] (4,4,6,5,6,2,2,10).\n\\end{enumerate}% Ответ: дереву (a) соответствует код (b), дереву (c) соответствует код (a), дереву (b) и коду (c) ничего не соответствует.\n\n\n',NULL,NULL,NULL,NULL,'37','72',NULL),(38,NULL,'Пусть $V = \\{1,2,3,4,5,6,7,8\\}$. Сколько существует графов, изоморфных графу $G$ на рисунке, на множестве вершин $V$ (сам граф $G$ также считается)?% ответ: 8!/4\n\\[\\begin{tikzpicture}[scale=0.7]\n\\node (p1) at (-1,0) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$1$}] {};\n\\node (p2) at (0,0) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$2$}] {};\n\\node (p3) at (1,0) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$3$}] {};\n\\node (p4) at (2,0) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$4$}] {};\n\\node (p5) at (3,0) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$5$}] {};\n\\node (p6) at (4,0) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$6$}] {};\n\\node (p7) at (5,0) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$7$}] {};\n\\node (p8) at (6,0) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$8$}] {};\n\\draw (p2) -- (p3) -- (p4) -- (p5) -- (p6) -- (p7);\n\\draw (2.5,-0.5) node {\\tiny{Граф $G$.}};\n\\end{tikzpicture}\\]\n\n\n',NULL,NULL,NULL,NULL,'38','53',NULL),(39,NULL,'Предположим, на листике тетради в клетку ученик произвольно в узлах клеточек проставил $5$ точек. Необходимо доказать, что как минимум один отрезок с вершинами в этих точках пройдет через узел клеточки.\n\n\n',NULL,NULL,NULL,NULL,'39','47',NULL),(40,NULL,'Докажите, что предпоследняя цифра десятичной записи любой степени тройки чётна.\n\n\n',NULL,NULL,NULL,NULL,'40','50',NULL),(41,NULL,'На кольцевой дороге стоят бензоколонки. Общее количество бензина в них достаточно, чтобы объехать круг. Докажите, что автомобиль с пустым баком может стартовать от некоторой бензоколонки и, заправляясь по дороге, объехать весь круг. (Бак достаточно большой.)\n\n\n',NULL,NULL,NULL,NULL,'41','48',NULL),(42,NULL,'Назовём раскраску рёбер дерева \\emph{правильной}, если ни в какой вершине дерева не сходятся два ребра одного цвета (т.е. из каждой вершины дерева выходит букет разноцветных рёбер). Докажите методом математической индукции, что если $k\\in\\bbN$ и у произвольного дерева из каждой вершины выходят не более чем $k$ рёбер, то у дерева существует правильная раскраска, задействующая не более $k$ цветов.\n\n\n',NULL,NULL,NULL,NULL,'42','50',NULL),(43,NULL,'Используя формулу включений-исключений, найдите формулу для количества различных ($\\neq$ неизоморфных!) графов на множестве вершин $\\{1,\\,2,\\,\\ldots,\\,n\\}$, в которых нет изолированных вершин.\n\n',NULL,NULL,NULL,NULL,'43','77',NULL),(44,NULL,'Существует ли унициклический граф, последовательность степеней вершин которого будет равна  $(1,1,1,1,1,1,2,3,3,4,4)?$ Если да, то постройте такой граф.\n\n',NULL,NULL,NULL,NULL,'44','69',NULL),(45,NULL,'Существует ли унициклический граф, последовательность степеней вершин которого будет равна\n$(1,1,1,1,1,1,1,2,4,4,5)?$ Если да, то постройте такой граф.\n\n',NULL,NULL,NULL,NULL,'45','69',NULL),(46,NULL,'Существует ли унициклический граф, последовательность степеней вершин которого будет равна\n$(1,1,1,1,1,1,2,3,3,3,5)?$ Если да, то постройте такой граф.\n\n',NULL,NULL,NULL,NULL,'46','69',NULL),(47,NULL,'Сколько существует попарно неизоморфных помеченных унициклических графов на $n\\ge 9$ вершинах с циклом длины $7$?\n\n',NULL,NULL,NULL,NULL,'47','69',NULL),(48,NULL,'Сколько различных \\emph{помеченных} деревьев соответствуют непомеченному дереву на рисунке?\n\\begin{center}\n\\begin{tikzpicture}[scale=0.7]\n\\draw (0,0) -- (1,1) -- (0,2) -- (-0.8,3);\n\\draw (2,0) -- (1,1) -- (2,2) -- (2.8,3);\n\\draw (2,3) -- (2,2);\n\\draw (1.2,3) -- (2,2);\n\\draw (0.8,3) -- (0,2);\n\\draw (0,3) -- (0,2);\n\\filldraw [fill=white] (0,0) circle (0.08);\n\\filldraw [fill=white] (2,0) circle (0.08);\n\\filldraw [fill=white] (1,1) circle (0.08);\n\\filldraw [fill=white] (2,2) circle (0.08);\n\\filldraw [fill=white] (0,2) circle (0.08);\n\\filldraw [fill=white] (0.8,3) circle (0.08);\n\\filldraw [fill=white] (0,3) circle (0.08);\n\\filldraw [fill=white] (-0.8,3) circle (0.08);\n\\filldraw [fill=white] (1.2,3) circle (0.08);\n\\filldraw [fill=white] (2,3) circle (0.08);\n\\filldraw [fill=white] (2.8,3) circle (0.08);\n\\end{tikzpicture}\n\\end{center}\n\n',NULL,NULL,NULL,NULL,'48','53',NULL),(49,NULL,'Сколько различных \\emph{помеченных} деревьев соответствуют непомеченному дереву на рисунке?\n\\begin{center}\n\\begin{tikzpicture}[scale=0.7]\n\\draw (0,0) -- (1,1) -- (1,1.5) -- (0,2) -- (-0.5,2.5);\n\\draw (2,0) -- (1,1);\n\\draw (1,1.5) -- (2,2) -- (2.5,2.5);\n\\draw (0.5,2.5) -- (0,2);\n\\draw (0.5,2) -- (1,1.5);\n\\draw (1.5,2) -- (1,1.5);\n\\draw (1.5,2.5) -- (2,2);\n\\filldraw [fill=white] (0,0) circle (0.08);\n\\filldraw [fill=white] (2,0) circle (0.08);\n\\filldraw [fill=white] (1,1) circle (0.08);\n\\filldraw [fill=white] (1,1.5) circle (0.08);\n\\filldraw [fill=white] (0,2) circle (0.08);\n\\filldraw [fill=white] (0.5,2) circle (0.08);\n\\filldraw [fill=white] (1.5,2) circle (0.08);\n\\filldraw [fill=white] (2,2) circle (0.08);\n\\filldraw [fill=white] (-0.5,2.5) circle (0.08);\n\\filldraw [fill=white] (0.5,2.5) circle (0.08);\n\\filldraw [fill=white] (1.5,2.5) circle (0.08);\n\\filldraw [fill=white] (2.5,2.5) circle (0.08);\n\\end{tikzpicture}\n\\end{center}\n\n',NULL,NULL,NULL,NULL,'49','53',NULL),(50,NULL,'Докажите, что количество помеченных лесов на $n$~вершинах с $r$~компонентами, каждая из которых содержит ровно по одной вершине из множества $ \\{1, \\ldots, r\\} $, в точности $rn^{n-1-r}$~штук.\n\n',NULL,NULL,NULL,NULL,'50','69',NULL),(51,NULL,'Докажите, что количество классов изоморфизма деревьев с $n$ вершинами (т.~е. количество различных деревьев с $n$\nнезанумерованными вершинами) меньше $4^n$.\n\n',NULL,NULL,NULL,NULL,'51','69',NULL),(52,NULL,'Пусть $T_n$ обозначает число помеченных деревьев с $n$~вершинами. Докажите тождество \\[2(n-1)T_n=\\sum_{k=1}^{n-1}C_n^k k(n-k) T_kT_{n-k}.\\]\n\n',NULL,NULL,NULL,NULL,'52','69',NULL),(53,NULL,'Сколько существует графов, изоморфных графу $G$ на рисунке, на множестве вершин $\\{1,2,\\ldots,8\\}$ (сам граф $G$ также считается)?% ответ: 8!/4\n\\[\\begin{tikzpicture}[scale=0.7]\n\\node (p1) at (0,0) [scale=0.3,shape=circle,draw=black,fill=white,label=-90:\\tiny{$1$}] {};\n\\node (p2) at (1,0) [scale=0.3,shape=circle,draw=black,fill=white,label=-90:\\tiny{$2$}] {};\n\\node (p3) at (1.5,0.86) [scale=0.3,shape=circle,draw=black,fill=white,label=-45:\\tiny{$3$}] {};\n\\node (p4) at (1,1.72) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$4$}] {};\n\\node (p5) at (0,1.72) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$5$}] {};\n\\node (p6) at (-0.5,0.86) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$6$}] {};\n\\node (p7) at (2.5,0.86) [scale=0.3,shape=circle,draw=black,fill=white,label=-90:\\tiny{$7$}] {};\n\\node (p8) at (3.5,0.86) [scale=0.3,shape=circle,draw=black,fill=white,label=-90:\\tiny{$8$}] {};\n\\draw (p2) -- (p5);\n\\draw (p1) -- (p4);\n\\draw (p1) -- (p2) -- (p3) -- (p4) -- (p5) -- (p6) -- (p1);\n\\draw (p3) -- (p7) -- (p8);\n\\draw (1.5,-0.6) node {\\tiny{Граф $G$.}};\n\\end{tikzpicture}\\]%Ответ: (3/5)8!.\n\n\n',NULL,NULL,NULL,NULL,'53','53',NULL),(54,NULL,'При каких натуральных $n$ у графа на $n$ вершинах может быть ровно $(n-1)$ центральная вершина?\n\n\n',NULL,NULL,NULL,NULL,'54','83',NULL),(55,NULL,'\\emph{Диаметральной цепью} в графе называется кратчайшая цепь, соединяющая произвольную пару вершин, находящихся на расстоянии диаметра графа. Докажите, что в дереве любые две диаметральные цепи имеют хотя бы одну общую вершину. Верно ли это утверждение для произвольных связных графов?\n\n',NULL,NULL,NULL,NULL,'55','83',NULL),(56,NULL,'Вершины графа ниже занумерованы по возрастанию слева направо, сверху вниз (номера вершин обозначе