LL,NULL,NULL,NULL,'57','46',NULL),(58,NULL,'Назовём граф $G=(V,E)$ на $n$ вершинах \\emph{$k$-критическим}, если $\\chi(G)=k$, и при этом при удалении любой вершины хроматическое число графа уменьшается. Докажите, что $|E|\\ge n(k-1)/2$.\n\n',NULL,NULL,NULL,NULL,'58','66',NULL),(59,NULL,'Найдите хроматическое число и хроматический индекс графа на рисунке. Ответ обоснуйте.\n\\[\\begin{tikzpicture}[scale=0.7][scale=0.8]\n \\node (vrtx 1) at (2,0) [scale=0.3,shape=circle,draw=black,fill=white] {};\n \\node (vrtx 2) at (0,-1) [scale=0.3,shape=circle,draw=black,fill=white] {};\n \\node (vrtx 3) at (1,-1) [scale=0.3,shape=circle,draw=black,fill=white] {};\n \\node (vrtx 4) at (2,-1) [scale=0.3,shape=circle,draw=black,fill=white] {};\n \\node (vrtx 5) at (3,-1) [scale=0.3,shape=circle,draw=black,fill=white] {};\n \\node (vrtx 6) at (4,-1) [scale=0.3,shape=circle,draw=black,fill=white] {};\n \\node (vrtx 7) at (1,-2) [scale=0.3,shape=circle,draw=black,fill=white] {};\n \\node (vrtx 8) at (3,-2) [scale=0.3,shape=circle,draw=black,fill=white] {};\n \\node (vrtx 9) at (0,-3) [scale=0.3,shape=circle,draw=black,fill=white] {};\n \\node (vrtx 10) at (4,-3) [scale=0.3,shape=circle,draw=black,fill=white] {};\n \\draw (vrtx 1) -- (vrtx 2);\n \\draw (vrtx 1) -- (vrtx 6);\n \\draw (vrtx 2) -- (vrtx 3);\n \\draw (vrtx 3) -- (vrtx 4);\n \\draw (vrtx 4) -- (vrtx 5);\n \\draw (vrtx 5) -- (vrtx 6);\n \\draw (vrtx 2) -- (vrtx 9);\n \\draw (vrtx 9) -- (vrtx 10);\n \\draw (vrtx 6) -- (vrtx 10);\n \\draw (vrtx 9) -- (vrtx 7);\n \\draw (vrtx 7) -- (vrtx 5);\n \\draw (vrtx 3) -- (vrtx 8);\n \\draw (vrtx 8) -- (vrtx 10);\n \\end{tikzpicture}\\]\n\n',NULL,NULL,NULL,NULL,'59','66',NULL),(60,NULL,'Найдите хроматическое число и хроматический индекс графа на рисунке. Ответ обоснуйте.\n\\[\\begin{tikzpicture}[scale=0.7][scale=0.8]\n \\node (vrtx 1) at (2,0) [scale=0.3,shape=circle,draw=black,fill=white] {};\n \\node (vrtx 2) at (0,-1) [scale=0.3,shape=circle,draw=black,fill=white] {};\n \\node (vrtx 3)