) -- (4,1) -- (5,1) -- (6,2);\n\\draw (0,0) -- (1,1);\n\\draw (0,0) -- (2,1);\n\\draw (6,0) -- (4,1);\n\\draw (6,0) -- (5,1);\n\\draw (0,2) -- (2,1);\n\\draw (6,2) -- (4,1);\n\\draw (0,2) .. controls (7,3) and (8,2) .. (6,0);\n\\draw (6,2) .. controls (8,0) and (7,-1) .. (0,0);\n\\draw (8,0) -- (8,2);\n\\draw (14,2) -- (14,0) --(8,0);\n\\draw (8,2) -- (9,1) -- (10,1) -- (12,1) -- (13,1) -- (14,2);\n\\draw (8,0) -- (9,1);\n\\draw (8,0) -- (10,1);\n\\draw (14,0) -- (12,1);\n\\draw (14,0) -- (13,1);\n\\draw (8,2) -- (10,1);\n\\draw (14,2) -- (12,1);\n\\draw (8,2) .. controls (15,3) and (16,2) .. (14,0);\n\\draw (14,2) .. controls (16,0) and (15,-1) .. (8,0);\n\\filldraw [fill=white] (0,0) circle (0.08);\n\\filldraw [fill=white] (0,2) circle (0.08);\n\\filldraw [fill=white] (1,1) circle (0.08);\n\\filldraw [fill=white] (2,1) circle (0.08);\n\\filldraw [fill=white] (4,1) circle (0.08);\n\\filldraw [fill=white] (5,1) circle (0.08);\n\\filldraw [fill=white] (6,0) circle (0.08);\n\\filldraw [fill=white] (6,2) circle (0.08);\n\\filldraw [fill=white] (8,0) circle (0.08);\n\\filldraw [fill=white] (8,2) circle (0.08);\n\\filldraw [fill=white] (9,1) circle (0.08);\n\\filldraw [fill=white] (10,1) circle (0.08);\n\\filldraw [fill=white] (12,1) circle (0.08);\n\\filldraw [fill=white] (13,1) circle (0.08);\n\\filldraw [fill=white] (14,0) circle (0.08);\n\\filldraw [fill=white] (14,2) circle (0.08);\n\\end{tikzpicture}\\]\n\n\n',NULL,NULL,NULL,NULL,'72','52',NULL),(73,NULL,'Квадратная таблица $(2n+1)\\times(2n+1)$, где $n\\in\\mathbb{N}$, заполнена числами от $1$ до $2n+1$ так, что в каждой строке и в каждом столбце представлены все эти числа. Докажите, что если это расположение симметрично относительно диагонали таблицы, то на этой диагонали тоже представлены все эти числа.\n\n',NULL,NULL,NULL,NULL,'73','47',NULL),(74,NULL,'Докажите, что число, состоящее из $3^n$ единиц, где $n\\in\\mathbb{N}$, делится на $3^n$.\n\n',NULL,NULL,NULL,NULL,'74','50',NULL),(75,NULL,'Числа $p$ и $q$ --- нечётные простые, $2^p - 1 \\equiv 0 \\pmod q$. Докажите, что $q - 1 \\equiv 0 \\pmod p$.\n\n',NULL,NULL,NULL,NULL,'75','73',NULL),(76,NULL,'Докажите, что если $x^2+1$ делится на нечётное простое $p$, то $p=4k+1$.\n\n\n',NULL,NULL,NULL,NULL,'76','73',NULL),(77,NULL,'Есть $n$ прямых общего положения и $n$ точек, где $n\\in\\mathbb{N}$. Докажите, что их можно занумеровать так, что перпендикуляры, опущенные из этих точек на прямые с теми же номерами, не будут пересекаться.\n\n\n',NULL,NULL,NULL,NULL,'77','48',NULL),(78,NULL,'Пусть $p$ --- простое нечётное число, не равное $5$. Применив малую теорему Ферма, докажите, что среди чисел, записываемых только единицами, есть число, которое делится на $p$.\n\n',NULL,NULL,NULL,NULL,'78','73',NULL),(79,NULL,'Весёлая компания из $10$ супружеских пар разбивается на $5$ групп по $4$ человека для лодочной прогулки так, чтобы в одной лодке оказались двое мужчин и двое женщин. Во скольких случаях Леонид Иванович Комбинаторщиков (один из участников Весёлой компании) окажется в одной лодке со своей женой?\n\n\n',NULL,NULL,NULL,NULL,'79','86',NULL),(80,NULL,'Объединением графов $G\'=(V\',\\,E\')$ и $G\'\'=(V\'\',\\, E\'\')$ называется граф $G=(V,\\,E)$, такой, что $V=V\'\\cup V\'\'$ и $E=E\'\\cup E\'\'$. Пусть $\\omega\'$ и $\\omega\'\'$ — кликовое число графов $G\'$ и $G\'\'$ соответственно. Дайте достижимую нижнюю оценку на кликовое число графа $G$. Докажите, что для любых натуральных $k\',\\,k\'\'$ бывают графы $G\'$ и $G\'\'$, для которых $\\omega(G\')=k\'$, $\\omega(G\'\')=k\'\'$, и $\\omega(G)\\ge k\'\\cdot k\'\'$.\n\n\n',NULL,NULL,NULL,NULL,'80','82',NULL),(81,NULL,'Пусть $k,n\\in\\bbN$ и $3\\le k\\le n$. Докажите, что если в графе на $n$ вершинах степень каждой вершины не меньше чем $(n-k+2)$, то граф обязательно содержит цикл, длина которого не превосходит $k$.\n\n\n',NULL,NULL,NULL,NULL,'81','71',NULL),(82,NULL,'Установите соответствие (не обязательно биекцию) между деревьями на рисунке и кодами Прюфера.\n\\[\\begin{tikzpicture}[scale=0.5]\n\\node (p1) at (0,1) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$1$}] {};\n\\node (p2) at (1,1) [scale=0.3,shape=circle,draw=black,fill=white,label=-90:\\tiny{$2$}] {};\n\\node (p3) at (-2,2) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$3$}] {};\n\\node (p4) at (0,0) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$4$}] {};\n\\node (p5) at (-1,1) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$5$}] {};\n\\node (p6) at (2,3) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$6$}] {};\n\\node (p7) at (0,3) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$7$}] {};\n\\node (p8) at (1,2) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$8$}] {};\n\\node (p9) at (0,2) [scale=0.3,shape=circle,draw=black,fill=white,label=-45:\\tiny{$9$}] {};\n\\node (p10) at (-1,2) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$10$}] {};\n\\draw (p3) -- (p5) -- (p4) -- (p2) -- (p8) -- (p6);\n\\draw (p4) -- (p1) -- (p10);\n\\draw (p1) -- (p9) -- (p7);\n\\draw (0,-0.8) node {\\emph{\\tiny{$(a)$}}};\n\\node (p11) at (5,1) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$1$}] {};\n\\node (p12) at (6,2) [scale=0.3,shape=circle,draw=black,fill=white,label=-90:\\tiny{$2$}] {};\n\\node (p13) at (3,2) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$3$}] {};\n\\node (p14) at (5,0) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$4$}] {};\n\\node (p15) at (4,1) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$5$}] {};\n\\node (p16) at (6,4) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$6$}] {};\n\\node (p17) at (7,2) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$7$}] {};\n\\node (p18) at (6,3) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$8$}] {};\n\\node (p19) at (6,1) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$9$}] {};\n\\node (p20) at (4,2) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$10$}] {};\n\\draw (p13) -- (p15) -- (p14) -- (p19) -- (p17);\n\\draw (p14) -- (p11) -- (p20);\n\\draw (p11) -- (p12) -- (p18) -- (p16);\n\\draw (5,-0.8) node {\\emph{\\tiny{$(b)$}}};\n\\node (p21) at (11,1) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$1$}] {};\n\\node (p22) at (10,2) [scale=0.3,shape=circle,draw=black,fill=white,label=-90:\\tiny{$2$}] {};\n\\node (p23) at (9,2) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$3$}] {};\n\\node (p24) at (10,0) [scale=0.3,shape=circle,draw=black,fill=white,label=-45:\\tiny{$4$}] {};\n\\node (p25) at (9,1) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$5$}] {};\n\\node (p26) at (10,4) [scale=0.3,shape=circle,draw=black,fill=white,label=180:\\tiny{$6$}] {};\n\\node (p27) at (11,3) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$7$}] {};\n\\node (p28) at (10,3) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$8$}] {};\n\\node (p29) at (11,2) [scale=0.3,shape=circle,draw=black,fill=white,label=0:\\tiny{$9$}] {};\n\\node (p30) at (12,1) [scale=0.3,shape=circle,draw=black,fill=white,label=90:\\tiny{$10$}] {};\n\\draw (p23) -- (p25) -- (p24) -- (p21) -- (p30);\n\\draw (p24) -- (p21) -- (p22) -- (p28) -- (p26);\n\\draw (p21) -- (p29) -- (p27);\n\\draw (10,-0.8) node {\\emph{\\tiny{$(c)$}}};\n\\end{tikzpicture}\\]\n\\begin{enumerate}\n\\item[(a)] (5,4,8,9,2,1,4,1);\n\\item[(b)] (5,4,8,9,2,1,1,4);\n\\item[(c)] (5,4,8,9,2,4,1,1).\n\\end{enumerate}% Ответ: дереву (a) соответствует код (c), дереву (b) соответствует код (a), дереву (c) и коду (b) ничего не соответствует.\n\n',NULL,NULL,NULL,NULL,'82','72',NULL),(83,NULL,'Рёберным графом графа $G$ называется граф $G\'$, такой, что вершины графа $G\'$ соответствуют рёбрам $G$, и две вершины в $G\'$ смежны тогда и только тогда, когда соответствующие им рёбра в $G$ имеют общий конец. Докажите или опровергните утверждение: «если в $G$ есть эйлеров цикл, то и в $G\'$ также есть эйлеров цикл».\n\n',NULL,NULL,NULL,NULL,'83','80',NULL),(84,NULL,'Постройте \\textbf{троичную} последовательность де Брёйна порядка два, начинающуюся с «$220\\ldots$». Сделайте это, найдя эйлеров цикл в соответствующем графе.\n\n',NULL,NULL,NULL,NULL,'84','85',NULL),(85,NULL,'В группе $20$ студентов, из которых $5$ математиков-олимпиадников, $10$ обычных студентов и $5$… кхм… не слишком сильных. Сколькими способами студентов можно разбить на две команды для матбоя, так, чтобы в каждой команде оказался хотя бы один олимпиадник и все не слишком хорошие студенты не попали в одну команду?\n\n',NULL,NULL,NULL,NULL,'85','86',NULL),(86,NULL,'Окружность разбита на $2015$ равных пронумерованных дуг. Сколькими способами можно раскрасить эти дуги в красный и синий цвета, так, чтобы ни одна красная дуга не была окружена двумя синими дугами? Раскраски, отличающиеся друг от друга поворотами окружности, считайте разными.\n\n',NULL,NULL,NULL,NULL,'86','77',NULL),(87,NULL,'С помощью графа де\\,Брёйна постройте двоичную последовательность де\\,Брёйна порядка $4$, заканчивающуюся последовательностью 101111.\n\n',NULL,NULL,NULL,NULL,'87','85',NULL),(88,NULL,'С помощью графа де\\,Брёйна постройте двоичную последовательность де\\,Брёйна порядка $4$, заканчивающуюся последовательностью 000110.\n\n',NULL,NULL,NULL,NULL,'88','85',NULL),(89,NULL,'Эйлеров ли этот граф? Если да, то найдите в нём эйлеров цикл, если нет, то найдите минимальное число рёбер, которые необходимо из него удалить, чтобы он стал эйлеровым. Ответ обоснуйте.\n\\[\\begin{tikzpicture}[scale=0.7]\n\\draw (0,0) -- (0,3);\n\\draw (0,0) -- (4,0);\n\\draw (4,0) -- (4,3);\n\\draw (0,3) -- (4,3);\n\\draw (0,3) -- (2,2.5);\n\\draw (4,3) -- (2,2.5);\n\\draw (2,2.5) -- (1,2);\n\\draw (2,2.5) -- (3,2);\n\\draw (1,2) -- (1,1);\n\\draw (1,2) -- (3,2);\n\\draw (3,2) -- (3,1);\n\\draw (1,1) -- (3,1);\n\\draw (1,1) -- (2,0.5);\n\\draw (3,1) -- (2,0.5);\n\\draw (0,0) -- (2,0.5);\n\\draw (2,0.5) -- (4,0);\n\\draw (0,3) -- (1,2);\n\\draw (0,3) -- (1,1);\n\\draw (4,3) -- (3,2);\n\\draw (4,3) -- (3,1);\n\\draw (4,0) -- (3,1);\n\\draw (4,0) -- (1,2);\n\\draw (0,0) -- (3,2);\n\\draw (0,0) -- (1,1);\n\\filldraw [fill=white]  (0,0) circle (0.08);\n\\filldraw [fill=white] (4,0) circle (0.08);\n\\filldraw [fill=white] (2,0.5) circle (0.08);\n\\filldraw [fill=white] (1,1) circle (0.08);\n\\filldraw [fill=white] (3,1) circle (0.08);\n\\filldraw [fill=white] (1,2) circle (0.08);\n\\filldraw [fill=white] (3,2) circle (0.08);\n\\filldraw [fill=white] (2,2.5) circle (0.08);\n\\filldraw [fill=white] (0,3) circle (0.08);\n\\filldraw [fill=white] (4,3) circle (0.08);\n\\end{tikzpicture}\\]\n\n\n',NULL,NULL,NULL,NULL,'89','80',NULL),(90,NULL,'Эйлеров ли этот граф? Если да, то найдите в нём эйлеров цикл, если нет, то найдите минимальное число рёбер, которые необходимо из него удалить, чтобы он стал эйлеровым. Ответ обоснуйте.\n\\[\\begin{tikzpicture}[scale=0.7]\n\\draw (1,0) -- (0,2);\n\\draw (0,2) -- (2,3);\n\\draw (2,3) -- (4,2);\n\\draw (4,2) -- (3,0);\n\\draw (1,0) -- (3,0);\n\\draw (1,0) -- (1,1);\n\\draw (1,1) -- (1,2);\n\\draw (1,2) -- (2,3);\n\\draw (3,0) -- (3,1);\n\\draw (3,1) -- (3,2);\n\\draw (3,2) -- (2,3);\n\\draw (0,2) -- (1,2) -- (3,2) -- (4,2);\n\\draw (2,3) -- (2,2.5) -- (1,2);\n\\draw (2,2.5) -- (3,2);\n\\draw (1,0) -- (2,0.5) -- (1,1) -- (3,1) -- (2,0.5) -- (3,0);\n\\draw (0,2) -- (1,1);\n\\draw (4,2) -- (3,1);\n\\draw (2,0.5) -- (2,2.5);\n\\filldraw [fill=white] (1,0) circle (0.08);\n\\filldraw [fill=white] (3,0) circle (0.08);\n\\filldraw [fill=white] (2,0.5) circle (0.08);\n\\filldraw [fill=white] (1,1) circle (0.08);\n\\filldraw [fill=white] (3,1) circle (0.08);\n\\filldraw [fill=white] (0,2) circle (0.08);\n\\filldraw [fill=white] (1,2) circle (0.08);\n\\filldraw [fill=white] (3,2) circle (0.08);\n\\filldraw [fill=white] (4,2) circle (0.08);\n\\filldraw [fill=white] (2,2.5) circle (0.08);\n\\filldraw [fill=white] (2,3) circle (0.08);\n\\end{tikzpicture}\\]\n\n\n',NULL,NULL,NULL,NULL,'90','80',NULL),(91,NULL,'Докажите, что если граф невозможно правильно раскрасить в $k-1$ цвет, то для любой его правильной раскраски в $k$ цветов существует путь, в котором встречается ровно по одной вершине каждого цвета.\n\n',NULL,NULL,NULL,NULL,'91','66',NULL),(92,NULL,'Докажите, что если максимальный несамопересекающийся путь в графе проходит через $d$ вершин,\nто граф можно правильно раскрасить в $d$ цветов.\n\n',NULL,NULL,NULL,NULL,'92','66',NULL),(93,NULL,'Докажите, что если максимальный нечётный несамопересекающийся цикл в графе проходит через $d-1$ вершину, то граф можно правильно раскрасить в $d$ цветов.\n\n',NULL,NULL,NULL,NULL,'93','66',NULL),(94,NULL,'Пусть $T_1,\\ldots,T_r$ --- деревья, множества вершин которых не~пересекаются. Сколько есть деревьев, множество вершин которых есть объединение множества вершин этих $r$ деревьев, и которые содержат $T_1,\\ldots, T_r?$\n\n',NULL,NULL,NULL,NULL,'94','69',NULL),(95,NULL,'Все рёбра связного графа раскрашены в два цвета. Из каждой вершины выходит поровну рёбер обоих цветов. Докажите, что тогда из любой вершины до любой другой можно добраться, каждый раз меняя цвет ребра.\n\n',NULL,NULL,NULL,NULL,'95','80',NULL),(96,NULL,'Рассмотрим вычеты по модулю $27$. Какие значения может принимать порядок элементов по этому модулю? Для каких элементов по модулю $27$ определено понятие порядка?\n\n',NULL,NULL,NULL,NULL,'96','73',NULL),(97,NULL,'Решите сравнение $42x\\equiv 15\\pmod{61}$.\n\n',NULL,NULL,NULL,NULL,'97','57',NULL),(98,NULL,'Решите сравнение $37x\\equiv 15\\pmod{59}$.\n\n',NULL,NULL,NULL,NULL,'98','57',NULL),(99,NULL,'Решите сравнение $76x\\equiv 40\\pmod{100}$. Решение необходимо записать по модулю $100$.\n\n',NULL,NULL,NULL,NULL,'99','54',NULL),(100,NULL,'Решите сравнение $90x\\equiv 114\\pmod{213}.$ Решение необходимо записать по модулю $213$.\n\n',NULL,NULL,NULL,NULL,'100','54',NULL),(101,NULL,'Решите сравнение $36x\\equiv 24\\pmod{120}.$ Решение необходимо записать по модулю $120$.\n\n',NULL,NULL,NULL,NULL,'101','54',NULL),(102,NULL,'Решите сравнение $78x\\equiv 189\\pmod{213}$. Решение необходимо записать по модулю $213$.\n\n',NULL,NULL,NULL,NULL,'102','57',NULL),(103,NULL,'Существует ли $k$, такое, что $3^k$ оканчивается на $\\ldots000081$?\n\n',NULL,NULL,NULL,NULL,'103','73',NULL),(104,NULL,'Существует ли $k$, такое, что ${13}^k$ оканчивается на $\\ldots0000169$?\n\n',NULL,NULL,NULL,NULL,'104','73',NULL),(105,NULL,'Существует ли $k$, такое, что $7^k$ оканчивается на $\\ldots000049$?\n\n',NULL,NULL,NULL,NULL,'105','73',NULL),(106,NULL,'Существует ли $k$, такое, что ${11}^k$ оканчивается на $\\ldots0000121$?\n\n',NULL,NULL,NULL,NULL,'106','73',NULL),(107,NULL,'Модифицируя формулу включений-исключений, докажите следующую формулу:\n\\[n! \\cdot x_1 x_2\\ldots x_n = (x_1 + x_2+ \\ldots + x_n)^n -\\]\n\\[- \\sum_{1 \\leqslant i_1<i_2<\\ldots < i_{n-1} \\leqslant n} (x_{i_1} + x_{i_2}+ \\ldots + x_{i_{n-1}})^n +\\]\n\\[+ \\sum_{1\\leqslant i_1<i_2<\\ldots < i_{n-2} \\leqslant n} (x_{i_1} + x_{i_2}+ \\ldots + x_{i_{n-2}})^n - \\ldots + (-1)^{n-1} \\sum_{i=1}^n x_i^n.\\]\nУказание: посчитайте двумя способами число упорядоченных мономов степени $n$ от переменных $x_1,x_2,\\ldots,x_n$, в которых встречаются все переменные.\n\n',NULL,NULL,NULL,NULL,'107','77',NULL),(108,NULL,'Найдите количество всех сюръективных отображений из $n$ элементного множества в $k$ элементное множество при $k\\leqslant n$.\n\n\n',NULL,NULL,NULL,NULL,'108','77',NULL),(109,NULL,'Сколькими способами можно посадить за круглый стол с $9$ местами $3$ англичан, $3$ французов и $3$ турок так, чтобы никакие \\emph{три} соотечественника не сидели рядом? Рассадки, совмещающиеся поворотами круглого стола считаются одинаковыми. Все люди в задаче различны. Тот же вопрос, но в случае, когда никакие два соотечественника не сидят рядом?\n\n',NULL,NULL,NULL,NULL,'109','86',NULL),(110,NULL,'Весёлая компания из $20$ супружеских пар разбивается на $5$ групп по $4$ человека для лодочной прогулки так, чтобы в одной лодке оказались двое мужчин и двое женщин. Во скольких случаях Леонид Иванович Комбинаторщиков и Степан Витальевич Дискретщиков (оба из Весёлой компании) окажутся каждый в одной лодке со своей женой?\n\n',NULL,NULL,NULL,NULL,'110','86',NULL),(111,NULL,'Для множества $X$ вершин графа будем через $\\calN(X)$ обозначать множество всех вершин, смежных с  вершинами из $X$ (кроме вершин самого множества $X$).\nПусть граф $G$ содержит такое \\emph{независимое} множество вершин $X\\subseteq V(G)$, что $|X|>|\\calN(X)|$. Докажите, что в $G$ нет гамильтоновых циклов.',NULL,NULL,NULL,NULL,'111','75',NULL),(112,NULL,'Для множества $X$ вершин графа будем через $\\calK(X)$ будем обозначать количество компонент связности, на которые распадается граф при удалении всех вершин множества $X$ (вершины удаляются вместе со всеми рёбрами, которые шли в них).\nДокажите, что, если граф $G$ гамильтонов, то для любого непустого подмножества вершин $A\\subseteq V(G)$ выполнено неравенство $\\calK(A)\\le |A|.$\n\n',NULL,NULL,NULL,NULL,'112','75',NULL),(113,NULL,'Гамильтонов ли следующий граф? (Если да, то найдите в нём гамильтонов цикл; если нет — докажите.)\n\\[\\begin{tikzpicture}[scale=0.7]\n\\draw (0,0) -- (-1,1) -- (-1,2) -- (0,3) -- (2,1) -- (1,0) -- (0,0);\n\\draw (-1,2) -- (2,2) -- (0,0);\n\\draw (1,0) -- (-1,2) -- (2,1) -- (1,3) -- (-1,2);\n\\draw (0,0) -- (0,3);\n\\draw (2,1) -- (2,2);\n\\draw (-1,1) -- (2,1);\n\\filldraw [fill=white] (0,0) circle (0.08);\n\\filldraw [fill=white] (1,0) circle (0.08);\n\\filldraw [fill=white] (-1,1) circle (0.08);\n\\filldraw [fill=white] (2,1) circle (0.08);\n\\filldraw [fill=white] (-1,2) circle (0.08);\n\\filldraw [fill=white] (2,2) circle (0.08);\n\\filldraw [fill=white] (0,3) circle (0.08);\n\\filldraw [fill=white] (1,3) circle (0.08);\n\\end{tikzpicture}\\]\n\n',NULL,NULL,NULL,NULL,'113','75',NULL),(114,NULL,'Гамильтонов ли следующий граф? (Если да, то найдите в нём гамильтонов цикл; если нет — докажите.)\n\\[\\begin{tikzpicture}[scale=0.7