.08);\n\\filldraw [fill=white] (2,2) circle (0.08);\n\\filldraw [fill=white] (1,3) circle (0.08);\n\\filldraw [fill=white] (0,3) circle (0.08);\n\\filldraw [fill=white] (1,3) circle (0.08);\n\\filldraw [fill=white] (-1,2) circle (0.08);\n\\filldraw [fill=white] (-1,1) circle (0.08);\n\\filldraw [fill=white] (0,1) circle (0.08);\n\\end{tikzpicture}\\]\n\n',NULL,NULL,NULL,NULL,'119','75',NULL),(120,NULL,'Пусть в связном графе $G$ есть мост (ребро, при удалении которого граф теряет связность). Докажите, что граф $G$ не содержит гамильтонова цикла.\n\n',NULL,NULL,NULL,NULL,'120','75',NULL),(121,NULL,'Докажите, что $p$ и $p+2$ одновременно просты тогда и только тогда, когда $4((p-1)!+1)+p\\equiv 0\\pmod{p^2+2p}$.\n\n',NULL,NULL,NULL,NULL,'121','64',NULL),(122,NULL,'Докажите, что $(p-1)! \\equiv -1 \\pmod{p}$ тогда и только тогда, когда $p$ --- простое.\n\n',NULL,NULL,NULL,NULL,'122','73',NULL),(123,NULL,'Найдите все целочисленные решения системы сравнений\n\\[\\left\\{\n\\begin{aligned}\n2x&\\equiv 4\\pmod{6} \\\\\n3x&\\equiv 12\\pmod{15} \\\\\n\\end{aligned}\n\\right.\\]\n\n',NULL,NULL,NULL,NULL,'123','64',NULL),(124,NULL,'Укажите все целые числа, удовлетворяющие системе\n\\[\\left\\{\n\\begin{aligned}\nx&\\equiv 3\\pmod{5} \\\\\nx&\\equiv 7\\pmod{17} \\\\\n\\end{aligned}\n\\right.\\]\n\n',NULL,NULL,NULL,NULL,'124','64',NULL),(125,NULL,'Укажите все целые числа, удовлетворяющие системе\n\\[\\left\\{\n\\begin{aligned}\nx&\\equiv 2\\pmod{3} \\\\\nx&\\equiv 3\\pmod{5} \\\\\nx&\\equiv 5\\pmod{7} \\\\\n\\end{aligned}\n\\right.\\]\n\n',NULL,NULL,NULL,NULL,'125','64',NULL),(126,NULL,'В классе 25 человек. Известно, что среди любых трех из них есть двое друзей. Докажите, что есть ученик, у которого не менее 12 друзей.',NULL,NULL,'2016-03-15 08:48:33','','126','47',NULL),(127,NULL,'Для любого $x\\geq -1$ и натурального $n$ докажите неравенство Бернулли: $(1+x)^n\\geq 1+nx$.\n\n',NULL,NULL,NULL,NULL,'127','50',NULL),(128,NULL,'Заполните все пустые клетки таблицы; в названиях укажите ударение.\\\\\n\\begin{tabularx}{\\linewidth}{|X|X|X|X|X|X|}\\hline\nСтрочная\\newline буква & Прописная\\newline буква & Название & Строчная\\newline буква & Прописная\\newline буква & Название\\\\\\hline\n$\\psi$ & & &  & $N$ & \\\\\\hline\n$\\delta$ & & &  & $\\Omega$ & \\\\\\hline\n$\\rho$ & & &  & $H$ & \\\\\\hline\n\\end{tabularx}\n\n\n',NULL,NULL,NULL,NULL,'128','49',NULL),(129,NULL,'Сформулируйте утверждение, обратное к теореме Оре (о гамильтоновости графа).\n\n',NULL,NULL,NULL,NULL,'129','44',NULL),(130,NULL,'Постройте граф с максимально возможным количеством рёбер на $8$ вершинах с кликовым числом равным $5$.\n\n\n',NULL,NULL,NULL,NULL,'130','82',NULL),(131,NULL,'Найдите все целочисленные решения системы сравнений\n\\[\\left\\{\n\\begin{aligned}\n15x&\\equiv 3\\pmod{39} \\\\\n21x&\\equiv 9\\pmod{57} \\\\\n\\end{aligned}\n\\right.\\]\n\n',NULL,NULL,NULL,NULL,'131','64',NULL),(132,NULL,'Найдите все первообразные корни по модулю $11$.\n\n',NULL,NULL,NULL,NULL,'132','65',NULL),(133,NULL,'Найдите все первообразные корни по модулю $17$.\n\n',NULL,NULL,NULL,NULL,'133','65',NULL),(134,NULL,'Существует ли такое $m$, что нет ни одного первообразного корня по модулю $m$? Если да, то приведите пример такого модуля и докажите несуществование первообразного корня по этому модулю; если нет --- докажите.\n\n',NULL,NULL,NULL,NULL,'134','65',NULL),(135,NULL,'Пусть $g$ --- первообразный корень по модулю $m.$ Докажите, что $g^l$ --- первообразный корень тогда и только тогда, когда $(l, \\phi(m)) = 1$.\n\n',NULL,NULL,NULL,NULL,'135','65',NULL),(136,NULL,'Найдите хотя бы один первообразный корень по модулю $27$.\n\n',NULL,NULL,NULL,NULL,'136','63',NULL),(137,NULL,'Найдите хотя бы один первообразный корень по модулю $49$.\n\n',NULL,NULL,NULL,NULL,'137','63',NULL),(138,NULL,'Найдите хотя бы один первообразный корень по модулю $289$.\n\n',NULL,NULL,NULL,NULL,'138','63',NULL),(139,NULL,'Найдите хотя бы один первообразный корень по модулю $50$.\n\n',NULL,NULL,NULL,NULL,'139','63',NULL),(140,NULL,'Найдите хотя бы один первообразный корень по модулю $98$.\n\n',NULL,NULL,NULL,NULL,'140','63',NULL),(141,NULL,'Найдите хотя бы один первообразный корень по модулю $54$.\n\n',NULL,NULL,NULL,NULL,'141','63',NULL),(142,NULL,'Найдите асимптотику величины $\\binom{3n+\\ln{n}}{2n}$ при $n\\to+\\infty$. Под нахождением асимптотики понимается нахождение такой функции $f$, между которой и оцениваемой величиной можно было бы поставить знак $\\sim$. Ответ принимается только в виде формулы, не содержащей неопределённостей вида $1^{\\infty}$, $0^0$, $(\\const+0)^\\infty$ и пр.\n\n',NULL,NULL,NULL,NULL,'142','76',NULL),(143,NULL,'Найдите асимптотику величины $\\binom{7n}{3n+\\ln{n}}$ при $n\\to+\\infty$. Под нахождением асимптотики понимается нахождение такой функции $f$, между которой и оцениваемой величиной можно было бы поставить знак $\\sim$. Ответ принимается только в виде формулы, не содержащей неопределённостей вида $1^{\\infty}$, $0^0$, $(\\const+0)^\\infty$ и пр. %Ответ: \\sqrt{7}{24\\pi e^{1/3+1/4}} \\cdot \\left(\\frac{7^7}{3^3 4^4}\\right)^n (4/3)^{\\sqrt{n}} \\cdot n^{-1/2}\n\n',NULL,NULL,NULL,NULL,'143','76',NULL),(144,NULL,'Найдите асимптотику величины $\\binom{5n+\\ln{n}}{2n}$ при $n\\to+\\infty$. Под нахождением асимптотики понимается нахождение такой функции $f$, между которой и оцениваемой величиной можно было бы поставить знак $\\sim$. Ответ принимается только в виде формулы, не содержащей неопределённостей вида $1^{\\infty}$, $0^0$, $(\\const+0)^\\infty$ и пр.\n\n',NULL,NULL,NULL,NULL,'144','76',NULL),(145,NULL,'Найдите асимптотику величины $\\binom{9n+\\ln{n}}{n}$ при $n\\to+\\infty$. Под нахождением асимптотики понимается нахождение такой функции $f$, между которой и оцениваемой величиной можно было бы поставить знак $\\sim$. Ответ принимается только в виде формулы, не содержащей неопределённостей вида $1^{\\infty}$, $0^0$, $(\\const+0)^\\infty$ и пр.\n\n',NULL,NULL,NULL,NULL,'145','76',NULL),(146,NULL,'Пусть $n\\to\\infty$. Вычислите асимптотику полиномиального коэффициента $P(2n,5n,n,\\sqrt{n})=\\frac{(8n+\\sqrt{n})!}{(2n)!(5n)!n!\\sqrt{n}!}$.\nПод нахождением асимптотики понимается нахождение такой функции $f$, между которой и оцениваемой величиной можно было бы поставить знак $\\sim$. Ответ принимается только в виде формулы, не содержащей неопределённостей вида $1^{\\infty}$, $0^0$, $(\\const+0)^\\infty$ и пр.\n\n',NULL,NULL,NULL,NULL,'146','76',NULL),(147,NULL,'Пусть  $n\\to\\infty$. Вычислите асимптотику полиномиального коэффициента $P(7n,2n,n,\\sqrt{n})=\\frac{(10n+\\sqrt{n})!}{(7n)!(2n)!n!\\sqrt{n}!}$.\nПод нахождением асимптотики понимается нахождение такой функции $f$, между которой и оцениваемой величиной можно было бы поставить знак $\\sim$. Ответ принимается только в виде формулы, не содержащей неопределённостей вида $1^{\\infty}$, $0^0$, $(\\const+0)^\\infty$ и пр.\n\n',NULL,NULL,NULL,NULL,'147','76',NULL),(148,NULL,'Пусть $n\\to\\infty$. Вычислите асимптотику полиномиального коэффициента $P(n,2n,3n+\\sqrt{n},\\sqrt{n})=\\frac{(6n+2\\sqrt{n})!}{n!(2n)!(3n+\\sqrt{n})!\\sqrt{n}!}$.\nПод нахождением асимптотики понимается нахождение такой функции $f$, между которой и оцениваемой величиной можно было бы поставить знак $\\sim$. Ответ принимается только в виде формулы, не содержащей неопределённостей вида $1^{\\infty}$, $0^0$, $(\\const+0)^\\infty$ и пр.\n\n',NULL,NULL,NULL,NULL,'148','76',NULL),(149,NULL,'Пусть $n\\to\\infty$. Вычислите асимптотику полиномиального коэффициента $P(n+\\sqrt{n},5n,3n,\\sqrt{n})=\\frac{(9n+2\\sqrt{n})!}{(n+\\sqrt{n})!(5n)!(3n)!\\sqrt{n}!}$.\nПод нахождением асимптотики понимается нахождение такой функции $f$, между которой и оцениваемой величиной можно было бы поставить знак $\\sim$. Ответ принимается только в виде формулы, не содержащей неопределённостей вида $1^{\\infty}$, $0^0$, $(\\const+0)^\\infty$ и пр.\n\n',NULL,NULL,NULL,NULL,'149','76',NULL),(150,NULL,'Пусть $f,g,h$ — неубывающие функции из $\\bbR^{+}$ в $\\bbR^{+}$. Пусть $n\\to\\infty$. Верно ли, что если $f(n)=O(g(n))$ и $g(n)=O(h(n))$, то обязательно $f(n)=O(h(n))$? Если верно, то обоснуйте, опираясь исключительно на определения. Если не верно в общем случае, то приведите соответствующий контрпример.\n\n',NULL,NULL,NULL,NULL,'150','70',NULL),(151,NULL,'Хирург З.\\,А.~Резников планирует удалить графу $K_{n,n}$ несколько рёбер, так, чтобы у графа не осталось ни одного совершенного паросочетания [наличие последних, видимо, портит графу внешность]. Каким минимально возможным количеством рёбер придётся-таки пожертвовать графу? Ответ обоснуйте, опираясь на теорему Холла.\n\n',NULL,NULL,NULL,NULL,'151','56',NULL),(152,NULL,'Докажите, что в любом двудольном регулярном непустом графе есть хотя бы одно совершенное паросочетание.\n\n',NULL,NULL,NULL,NULL,'152','56',NULL),(153,NULL,'Пусть $f,g,h$ — неубывающие функции из $\\bbR^{+}$ в $\\bbR^{+}$. Пусть $n\\to\\infty$. Верно ли, что если $f(n)=o(g(n))$ и $g(n)=o(h(n))$, то обязательно $f(n)=o(h(n))$? Если верно, то обоснуйте, опираясь исключительно на определения. Если не верно в общем случае, то приведите соответствующий контрпример.\n\n',NULL,NULL,NULL,NULL,'153','70',NULL),(154,NULL,'Пусть $f,g,h$ — неубывающие функции из $\\bbR^{+}$ в $\\bbR^{+}$. Пусть $n\\to\\infty$. Верно ли, что если $f(n)=o(g(n))$ и $g(n)=O(h(n))$, то обязательно $f(n)=o(h(n))$? Если верно, то обоснуйте, опираясь исключительно на определения. Если не верно в общем случае, то приведите соответствующий контрпример.\n\n',NULL,NULL,NULL,NULL,'154','70',NULL),(155,NULL,'Пусть $f,g,h$ — неубывающие функции из $R^{+}$ в $R^{+}$. Пусть $n\\to\\infty$. Верно ли, что если $f(n)=O(g(n))$ и $g(n)=o(h(n))$, то обязательно $f(n)=o(h(n))$? Если верно, то обоснуйте, опираясь исключительно на определения. Если не верно в общем случае, то приведите соответствующий контрпример.\n\n',NULL,NULL,NULL,NULL,'155','70',NULL),(156,NULL,'Заполните все пустые клетки таблицы; в названиях \\textbf{укажите ударение}.\\\\\n\\begin{tabularx}{\\linewidth}{|X|X|X|X|X|X|}\\hline\nСтрочная\\newline буква & Прописная\\newline буква & Название & Строчная\\newline буква & Прописная\\newline буква & Название\\\\\\hline\n$\\tau$ & & &  & $\\Xi$ & \\\\\\hline\n & $\\Omega$ & &  & $Z$ & \\\\\\hline\n$\\mu$ & & &  &  & тета \\\\\\hline\n\\end{tabularx}\n\n',NULL,NULL,NULL,NULL,'156','49',NULL),(157,NULL,'Пусть в двудольном графе $G$ с долями $X$ и $Y$ существует совершенное паросочетание, и пусть $\\deg v\\ge t$ для каждой вершины $v\\in X$. Докажите, что в $G$ найдутся не менее $t!$ различных совершенных паросочетаний.\n\n',NULL,NULL,NULL,NULL,'157','56',NULL),(158,NULL,'Функция $n(s)$ задана в виде $n:=\\max\\{n_0\\mid \\left(n_0!\\right)^{n_0}\\le s\\}$. Найдите асимптотику этой функции при $s\\to\\infty$.\n\n',NULL,NULL,NULL,NULL,'158','74',NULL),(159,NULL,'Функция $n(s)$ задана в виде $n:=\\max\\{n_0\\mid \\left(n_0!\\right)^{\\ln n_0}\\le s\\}$. Найдите асимптотику этой функции при $s\\to\\infty$.\n\n',NULL,NULL,NULL,NULL,'159','74',NULL),(160,NULL,'Положим $s(n)=\\min\\{m\\in\\mathbb{N}, m\\neq 0,1\\mid C_n^m\\cdot e^{-m^3/(\\ln m)^{10}}<1\\}$. Найдите асимптотику функции~$s(n)$.\n\n',NULL,NULL,NULL,NULL,'160','74',NULL),(161,NULL,'Положим $s(n)=\\min\\{m\\in\\mathbb{N}, m\\neq 0,1\\mid C_n^m\\cdot e^{-m^2/(\\ln m)^8}<1\\}$. Найдите асимптотику для~$s(n)$.\n\n\n',NULL,NULL,NULL,NULL,'161','74',NULL),(162,NULL,'Решите сравнение $x^{18}\\equiv 4\\pmod{31}$. Можете без доказательства пользоваться тем, что $3$ — первообразный корень по модулю $31$. Всю таблицу индексов выписывать не обязательно.\n\n',NULL,NULL,NULL,NULL,'162','84',NULL),(163,NULL,'Решите сравнение $x^{24}\\equiv 23\\pmod{29}$. Можете без доказательства пользоваться тем, что $2$ — первообразный корень по модулю $29$. Всю таблицу индексов выписывать не обязательно.\n\n',NULL,NULL,NULL,NULL,'163','84',NULL),(164,NULL,'Докажите, что существует элемент порядка ровно $2\\cdot 5^{50}$ по модулю $5^{100}$. Приведите пример элемента такого порядка.\n\n',NULL,NULL,NULL,NULL,'164','84',NULL),(165,NULL,'Докажите, что существует элемент порядка ровно $3\\cdot 7^{50}$ по модулю $7^{100}$. Приведите пример элемента такого порядка.\n\n',NULL,NULL,NULL,NULL,'165','84',NULL),(166,NULL,'Докажите, что существует элемент порядка ровно $5\\cdot 11^{100}$ по модулю $11^{200}$. Приведите пример элемента такого порядка.\n\n',NULL,NULL,NULL,NULL,'166','84',NULL),(167,NULL,'Пусть $p\\to\\infty$, $s=C_{p^4}^p$ и $n=C_{p^4}^{p^2}$. Найдите функцию~$f(s)$ в записи $n=(e+o(1))^{f(s)}$. Здесь $e=2.71828...$ --- основание натурального логарифма.\n\n',NULL,NULL,NULL,NULL,'167','74',NULL),(168,NULL,'Дан клетчатый прямоугольник размером $n\\times 2$, $n\\in\\bbN$. Обозначим символом $a_n$ число способов замостить этот прямоугольник фигурами двух типов: уголками размером $2\\times 2$ и доминошками размера $2\\times 1$ (см. рис. 1). Никакие две фигуры не должны перекрываться и каждая клетка прямоугольника должна быть покрыта некоторой фигурой. Выведите линейное рекуррентное соотношение для $a_n$ и укажите начальные условия, необходимые для его корректного задания. Замощения, совмещающиеся отражениями относительно обеих осей симметрии прямоугольника, считаются различными. Считайте, что $a_0=1$. Пример замощения прямоугольника размера $4\\times 2$ приведён на рис.2.\n\\[\\begin{tikzpicture}[scale=0.7]\n\\draw[step=1,black,very thin] (0,0) grid (1,2);\n\\draw (3,1) -- (4,1) -- (4,2) -- (3,2);\n\\draw[step=1,black,very thin] (2,0) grid (3,2);\n\\draw (2,-0.3) node {\\footnotesize{Рис. 1. Доминошка и уголок.}};\n\n\\filldraw[pattern=north east lines] (8,2) -- (8,0) -- (10,0) -- (10,1) -- (9,1) -- (9,2) -- (8,2);\n\\filldraw[pattern=horizontal lines] (10,0) -- (12,0) -- (12,2) -- (11,2) -- (11,1) -- (10,1) -- (10,0);\n\\filldraw[pattern=dots] (9,1) -- (9,2) -- (11,2) -- (11,1) -- (9,1);\n\\draw[step=1,black,very thin] (8,0) grid (12,2);\n\\draw (10,-0.3) node {\\footnotesize{Рис. 2. Пример замощения прямоугольника $4\\times 2.$}};\n\\end{tikzpicture}\\]\n%Ответ: $a_{n+3}-2a_{n+2}-a_n=0, a_0=1,a_1=1,a_2=2,a_3=5.$\n\n',NULL,NULL,NULL,NULL,'168','60',NULL),(169,NULL,'Дан клетчатый прямоугольник размером $n\\times 2$, $n\\in\\bbN$. Обозначим символом $a_n$ число способов замостить этот прямоугольник фигурами двух типов: уголками размером $2\\times 2$ и доминошками размера $3\\times 1$ (см. рис. 1). Никакие две фигуры не должны перекрываться и каждая клетка прямоугольника должна быть покрыта некоторой фигурой. Выведите линейное рекуррентное соотношение для $a_n$ и укажите начальные условия, необходимые для его корректного задания. Замощения, совмещающиеся отражениями относительно обеих осей симметрии прямоугольника, считаются различными. Считайте, что $a_0=1$. Пример замощения прямоугольника размера $6\\times 2$ приведён на рис.2.\n\\[\\begin{tikzpicture}[scale=0.7]\n\\draw[step=1,black,very thin] (0,0) grid (1,3);\n\\draw (3,1) -- (4,1) -- (4,2) -- (3,2);\n\\draw[step=1,black,very thin] (2,0) grid (3,2);\n\\draw (2,-0.3) node {\\footnotesize{Рис. 1. Доминошка и уголок.}};\n\n\\filldraw[pattern=north east lines] (7,2) -- (7,0) -- (9,0) -- (9,1) -- (8,1) -- (8,2) -- (7,2);\n\\filldraw[pattern=horizontal lines] (11,1) -- (12,1) -- (12,0) -- (13,0) -- (13,2) -- (11,2) -- (11,1);\n\\filldraw[pattern=dots] (9,0) -- (12,0) -- (12,1) -- (9,1) -- (9,0);\n\\filldraw[pattern=grid] (8,1) -- (11,1) -- (11,2) -- (8,2) -- (8,1);\n\\draw[step=1,black,very thin] (7,0) grid (13,2);\n\\draw (10,-0.3) node {\\footnotesize{Рис. 2. Пример замощения прямоугольника $6\\times 2.$}};\n\\end{tikzpicture}\\]\n%Ответ: $a_{n+6}-4a_{n+3}+a_n=0,a_0=1,a_1=a_2=0,a_3=3,a_4=a_5=0,a_6=11$\n\n\n',NULL,NULL,NULL,NULL,'169','60',NULL),(170,NULL,'Найдите линейное рекуррентное соотношение для последовательности $\\{a_n\\}_{n=0}^\\infty$, где $a_n$ --- количество двоичных слов длины $n$, не содержащих подслова ``110\'\' и вычислите $a_0$, $a_1$ и $a_2$.\n\n',NULL,NULL,NULL,NULL,'170','60',NULL),(171,NULL,'Найдите линейное рекуррентное соотношение для последовательности $\\{a_n\\}_{n=0}^\\infty$, где $a_n$ --- количество двоичных слов длины $n$, не содержащих подслова ``011\'\' и вычислите $a_0$, $a_1$ и $a_2$.\n\n',NULL,NULL,NULL,NULL,'171','60',NULL),(172,NULL,'Найдите линейное рекуррентное соотношение для последовательности $\\{a_n\\}_{n=0}^\\infty$, где $a_n$ --- количество двоичных слов длины $n$, не содержащих подслова ``010\'\' и вычислите $a_0$, $a_1$, $a_2$ и $a_3$.\n\n',NULL,NULL,NULL,NULL,'172','60',NULL),(173,NULL,'Лягушка прыгает по вершинам пятиугольника $ABCDE$ (вершины пятиугольника обозначаются буквами по часовой стрелке), стартовав из вершины $A$ и перемещаясь каждый раз в одну из соседних вершин. Обозначим через $K_n$ количество способов, которыми лягушка может попасть из вершины $A$ в вершину $B$ за $n$ прыжков. В траектории лягушки любые вершины могут повторяться сколько угодно раз (в том числе и вершины $A$ и $B$!), главное, чтобы лягушка сделала ровно $n$ прыжков и после $n$-го прыжка оказалась в вершине $B$. Выведите линейное рекуррентное соотношение для $K_n$.\n\n',NULL,NULL,NULL,NULL,'173','60',NULL),(174,NULL,'Лягушка прыгает по вершинам пятиугольника $ABCDE$ (вершины пятиугольника обозначаются буквами по часовой стрелке), стартовав из вершины $A$ и перемещаясь каждый раз в одну из соседних вершин. Обозначим через $K_n$ количество способов, которыми лягушка может попасть из вершины $A$ в неё же за $n$ прыжков. В траектории лягушки любые вершины могут повторяться сколько угодно раз (в том числе и вершина $A$!), главное, чтобы лягушка сделала ровно $n$ прыжков и после $n$-го прыжка оказалась в вершине $A$. Выведите линейное рекуррентное соотношение для $K_n$.\n\n',NULL,NULL,NULL,NULL,'174','60',NULL),(175,NULL,'Докажите, что матрицу из $\\{0,1\\}^{n\\times n}$, в каждой строке и столбце которой ровно $k$ единиц, можно представить в виде суммы $k$ матриц, в каждой строке и столбце у которых в точности по одной единице.\n\n',NULL,NULL,NULL,NULL,'175','56',NULL),(176,NULL,'Докажите, что эйлеров граф содержит единственный эйлеров цикл тогда и только тогда, когда граф является простым циклом.\n\n',NULL,NULL,NULL,NULL,'176','80',NULL),(177,NULL,'Пусть графы $G\'=(V\',E\')$ и $G\'\'=(V\'\',E\'\')$ имеют ровно одну общую вершину, то есть $|V\'\\cap V\'\'|=1$. Докажите, что граф $G=(V\'\\cup V\'\',\\,E\'\\cup E\'\')$ является эйлеровым тогда и только тогда, когда оба графа $G\'$ и $G\'\'$ эйлеровы.\n\n',NULL,NULL,NULL,NULL,'177','80',NULL),(178,NULL,'Пусть ребро $uv$ графа $G$ таково, что при удалении вершин $u$ и $v$ из графа $G$ он становится несвязным. Докажите, что в графе $G$ нет гамильтоновых циклов, проходящих через ребро $uv$.\n\n',NULL,NULL,NULL,NULL,'178','75',NULL),(179,NULL,'Пусть гамильтонов планарный граф $G$ можно уложить так, чтобы все вершины лежали на границе внешней грани. Докажите, что гамильтонов цикл в $G$ единственен.\n\n',NULL,NULL,NULL,NULL,'179','75',NULL),(180,NULL,'Докажите тождество с числами Фибоначчи: $F_{n+1}F_{n-1}-F_n^2=(-1)^n, n>0$.\n\n',NULL,NULL,NULL,NULL,'180','60',NULL),(181,NULL,'Докажите тождество с числами Фибоначчи: $F_{2n+1}=F_n^2+F_{n+1}^2, n>0$.\n\n',NULL,NULL,NULL,NULL,'181','60',NULL),(182,NULL,'Докажите тождество с числами Фибоначчи: $F_{n+1}F_{n+2}-F_nF_{n+3}=(-1)^{n+1}, n>0$.\n\n',NULL,NULL,NULL,NULL,'182','60',NULL),(183,NULL,'Докажите тождество с числами Фибоначчи: $F_{3n}=F_n^3+F_{n+1}^3-F_{n-1}^3, n>0$.\n\n',NULL,NULL,NULL,NULL,'183','60',NULL),(184,NULL,'Существует ли унициклический граф, последовательность степеней вершин которого будет равна  $(1,1,1,1,1,1,2,2,3,3,4)$? Если да, то постройте такой граф.\n\n',NULL,NULL,NULL,NULL,'184','69',NULL),(185,NULL,'Существует ли унициклический граф, последовательность степеней вершин которого будет равна $(1,1,1,1,1,1,1,3,3,3,4)$? Если да, то постройте такой граф.\n\n',NULL,NULL,NULL,NULL,'185','69',NULL),(186,NULL,'Существует ли унициклический граф, последовательность степеней вершин которого будет равна $(1,1,1,1,1,1,2,2,3,3,4)$? Если да, то постройте такой граф.\n\n',NULL,NULL,NULL,NULL,'186','69',NULL),(187,NULL,'Найдите частное решение рекуррентного соотношения $2u_{n+1}-5u_{n}-u_{n-1}+6u_{n-2}=0$ при начальных условиях $u_0=8,u_1=11$ и $u_2=22$.\n\n',NULL,NULL,NULL,NULL,'187','61',NULL),(188,NULL,'Найдите частное решение рекуррентного соотношения $2u_{n+5}+9u_{n+4}+12u_{n+3}+5u_{n+2}=0$ при начальных условиях $u_0=5,u_1=-12$ и $u_2=28$.\n\n',NULL,NULL,'2016-03-16 07:36:17','187','188','61',NULL),(189,NULL,'Найдите частное решение рекуррентного соотношения $y_{n+1}-4y_{n}-5y_{n-1}=0$ при начальных условиях $y_0=5, y_1=13.$\n\n',NULL,NULL,'2016-03-16 07:36:26','187','189','61',NULL),(190,NULL,'Найдите частное решение рекуррентного соотношения $y_{n+3}-5y_{n+2}+y_{n+1}+21y_{n}-18y_{n-1}=0$ при начальных условиях $y_0=4, y_1=1, y_2=28$ и $y_3=67.$\n\n',NULL,NULL,'2016-03-16 07:36:34','187','190','61',NULL),(191,NULL,'Дана последовательность $a_n$, заданная линейным рекуррентным соотношением $a_{n+3}-a_{n+2}-8a_{n+1}+12a_n=0$ и начальными условиями $a_0=1,a_1=0,a_2=-4$. Вычислите значение выражения $\\sum_{n=0}^{+\\infty}a_n\\left(\\frac{1}{3}\\right)^n$.\n\n\n',NULL,NULL,'2016-04-14 20:08:24','192','191','67',NULL),(192,NULL,'Дана последовательность $a_n$, заданная линейным рекуррентным соотношением $a_{n+3}+4a_{n+2}+a_{n+1}-6a_n=0$ и начальными условиями $a_0=2,a_1=-4,a_2=14$. Вычислите значение выражения $\\sum_{n=0}^{+\\infty}a_n\\left(\\frac{1}{5}\\right)^n$.',NULL,NULL,'2016-03-16 07:36:54','191','192','67',NULL),(193,NULL,'Используя метод производящих функций, вычислите сумму биномиальных коэффициентов:\n\\[\\sum_{s=0}^n(-1)^s \\binom{n}{s}^2.\\]',NULL,NULL,NULL,NULL,'193','67',NULL),(194,NULL,'Вычислите значение выражения\n\\[(1+x)^{2n}+2(1+x)^{2n-1}+4(1+x)^{2n-2}+\\ldots+2^n(1+x)^n.\\]\nСравнивая коэффициенты при $x^n$ в левой и правой части получившегося выражения, вычислите значение суммы\n\\[\\binom{2n}{n}+2\\binom{2n-1}{n}+4\\binom{2n-2}{n}+\\ldots+2^n\\binom{n}{n}.\\]\n\n\n',NULL,NULL,NULL,NULL,'194','67',NULL),(195,NULL,'Вычислите значение выражения\n\\[x^{2n}(1+x)^{2n}+x^{2n-1}(1+x)^{2n-1}+\\ldots+x(1+x)+1.\\]\nСравнивая коэффициенты при $x^{2n}$ у полученного равенства, вычислите значение суммы\n\\[\\binom{2n}{0}-\\binom{2n-1}{1}+\\binom{2n-2}{2}+\\ldots+(-1)^n\\binom{n}{n}.\\]',NULL,NULL,'2016-03-16 07:37:15','194','195','67',NULL),(196,NULL,'Считая двумя способами число сочетаний c повторениями длины $999$ из $1002$ символов, вычислите сумму:\n\\[\\sum\\limits_{k=1}^{1000}\\frac{\\binom{999}{k}}{\\binom{1999}{k}}.\\]\n\n',NULL,NULL,NULL,NULL,'196','67',NULL),(197,NULL,'Докажите, что число неупорядоченных разбиений числа $n$, в которых ни одно слагаемое не повторяется чаще, чем $2$ раза, равно числу неупорядоченных разбиений того же числа на слагаемые, ни одно из которых не делится на $3$.\n\n',NULL,NULL,NULL,NULL,'197','79',NULL),(198,NULL,'Докажите, что число неупорядоченных разбиений числа $n$, в которых ни одно слагаемое не повторяется чаще, чем $3$ раза, равно числу неупорядоченных разбиений того же числа на слагаемые, ни одно из которых не делится на $4$.\n\n',NULL,NULL,'2016-03-16 07:41:54','197','198','79',NULL),(199,NULL,'Найдите сумму количеств неупорядоченных разбиений натуральных чисел $1\\leqslant n\\leqslant 40$, таких, что каждое разбиение состоит не более, чем из $6$ слагаемых и максимальное слагаемое в каждом из которых не больше $7$.\n\n',NULL,NULL,NULL,NULL,'199','58',NULL),(200,NULL,'Найдите сумму количеств неупорядоченных разбиений натуральных чисел $1\\leqslant n\\leqslant 54$, таких, что каждое разбиение состоит не более, чем из $8$ слагаемых и максимальное слагаемое в каждом из которых не больше $7$.\n\n',NULL,NULL,'2016-03-16 07:42:14','199','200','58',NULL),(201,NULL,'Докажите, что среди любых $4^n$ натуральных чисел можно выбрать подмножество из $n$ чисел, каждая пара которых взаимно просты, либо выбрать $n$ чисел, каждая пара которых имеет общий делитель.\n\n',NULL,NULL,NULL,NULL,NULL,'88',NULL),(202,NULL,'В чемпионате хоккейной лиги расписание регулярного чемпионата составляется по следующему правилу: не обязательно каждый клуб играет со всеми другими, но среди любых трёх клубов хотя бы два из них должны сыграть матч между собой и никакая пара клубов не играет друг с другом больше одного раза. Всего в лиге играют $26$ клубов. Верно ли, что, как бы ни было составлено расписание, найдётся семь клубов, \\emph{каждые} два из которых играли матч друг с другом?\n\n',NULL,NULL,NULL,NULL,NULL,'88',NULL),(203,NULL,'На плоскости отметили $17$ точек и соединили каждые $2$ из них цветным отрезком: красным, желтым или зеленым.\nДокажите, что есть одноцветный треугольник.\n\n',NULL,NULL,NULL,NULL,NULL,'88',NULL),(204,NULL,'Докажите, что если в графе с 13 вершинами нет ни треугольника, ни 5-антиклики, то степень каждой вершины равна 4. \\textbf{Указание.} Используйте то, что $R(3,4)\\le 9.$\n\n',NULL,NULL,'2016-03-16 07:43:19','',NULL,'89',NULL),(205,NULL,'Определим число $Q(k,l)$ как наименьшее возможное натуральное число $N$ такое, что для любого натурального числа $n\\ge N$ при любой рёберной раскраске полного графа на $n$ вершинах в $l$ цветов обязательно найдётся вершина, из которой исходит хотя бы $k$ одноцветных рёбер. Найдите формулу, выражающую $Q(k,l)$ для любых значений параметров $k$ и $l$. Свой ответ обоснуйте.',NULL,NULL,NULL,NULL,NULL,'89',NULL),(206,NULL,'Определим число $Q(s_1,s_2)$ как \\emph{наименьшее} возможное натуральное число $N$ такое, что для любого натурального числа $n\\ge N$ при любой рёберной раскраске полного графа на $n$ вершинах в $2$ цвета либо найдётся простая цепь на $s_1$ вершинах, все рёбра которой закрашены в цвет $1$, либо есть простая цепь на $s_2$ вершинах, все рёбра которой закрашены в цвет $2$. Докажите, что $Q(s_1,s_2)\\le Q(s_1-1,s_2)+Q(s_1,s_2-1)$. Вычислите значение $Q(3,3).$',NULL,NULL,NULL,NULL,NULL,'89',NULL),(207,NULL,'Рассмотрим модель случайного графа на $n$ вершинах, которая была определена на семинаре, с вероятностью появления ребра $\\frac{1}{3}.$ Докажите, что в этом случайном графе асимптотически почти наверняка нет клик размера $10\\ln n$.',NULL,NULL,NULL,NULL,NULL,'92',NULL),(212,NULL,'Рассмотрим модель случайного графа на $n$ вершинах, которая была определена на семинаре, с вероятностью появления ребра $\\frac{1}{4}.$ Докажите, что в этом случайном графе асимптотически почти наверняка нет независимых множеств размера $20\\ln n$.',NULL,NULL,'2016-03-16 07:45:55','207',NULL,'92',NULL),(213,NULL,'Рассмотрим модель случайного графа на $n$ вершинах, которая была определена на семинаре, с вероятностью появления ребра $\\frac{1}{n^{\\frac{7}{4}}}.$ Докажите, что в этом случайном графе асимптотически почти наверняка нет подграфов, изоморфных простой цепи на  $3$ вершинах с $2$ рёбрами.',NULL,NULL,NULL,NULL,NULL,'93',NULL),(214,NULL,'Рассмотрим модель случайного графа на $n$ вершинах, которая была определена на семинаре, с вероятностью появления ребра $\\frac{1}{n^{\\frac{3}{2}}}.$ Докажите, что в этом случайном графе асимптотически почти наверняка нет вершин степени $3$ и выше.',NULL,NULL,'2016-03-16 07:46:52','213',NULL,'93',NULL),(215,NULL,'Рассмотрим модель случайного графа на $n$ вершинах, которая была определена на семинаре, с вероятностью появления ребра $\\frac{1}{5}.$ Докажите, что асимптотически почти наверняка хроматическое число данного графа больше, либо равно, чем $\\frac{n}{20\\ln n}$.',NULL,NULL,'2016-03-16 07:45:59','207',NULL,'93',NULL),(216,NULL,'Рассмотрим модель случайного графа на $n$ вершинах, которая была определена на семинаре, с вероятностью появления ребра $\\frac{1}{3}.$ Докажите, что асимптотически почти наверняка хроматическое число данного графа больше, либо равно, чем $\\frac{n}{20\\ln n}$.',NULL,NULL,'2016-03-16 07:46:03','207',NULL,'93',NULL),(217,NULL,'Найдите \\emph{асимптотику} математического ожидания количества порожденных подграфов случайного графа $G(n,\\frac{1}{3})$, являющихся простыми цепями на $k$ вершинах. Параметр $k$ фиксирован, а $n$ стремится к бесконечности.',NULL,NULL,NULL,NULL,NULL,'90',NULL),(218,NULL,'Надите матожидание числа связных компонент, в графе ${{G\\left(n,\\frac{1}{5}\\right)||G\\left(n,\\frac{1}{3}\\right)||G\\left(n,\\frac{1}{4}\\right)}}$, изоморфных графу на рисунке:\n$$\n{{\n\\begin{xy}\n\\xymatrix@R=1em@C=1em{\n&&&\\vrtx\\edge{dl}\\edge{dr}\\edge{dd}&\\\\\n\\vrtx\\edge{r}&\\vrtx\\edge{r}&\\vrtx\\edge{rr}\\edge{dr}&&\\vrtx\\edge{dl}\\\\\n&&&\\vrtx&}\n\\end{xy}\n||\n\\begin{xy}\n\\xymatrix@R=1em@C=1em{\n&\\vrtx\\edge{dl}\\edge{dd}\\edge{dr}\\edge{r}&\\vrtx\\edge{r}&\\vrtx\\\\\n\\vrtx\\edge{rr}\\edge{dr}&&\\vrtx\\edge{dl}&\\\\\n&\\vrtx\\edge{r}&\\vrtx&}\n\\end{xy}\n||\n\\begin{xy}\n\\xymatrix@R=1em@C=1em{\n\\vrtx\\edge{r}&\\vrtx\\edge{dl}\\edge{dr}&\\vrtx\\edge{d}\\edge{r}&\\vrtx\\\\\n\\vrtx\\edge{rr}\\edge{dr}&&\\vrtx\\edge{dl}&\\\\\n&\\vrtx&&}\n\\end{xy}\n}}\n$$',NULL,NULL,'2016-03-31 19:05:15','',NULL,'90',NULL),(219,NULL,'Докажите, что, если в модели $G(n,p)$ вероятность появления ребра $p$ равна $o\\left(\n n^{ {{ -\\frac{3}{2} \n|| -\\frac{4}{3} \n}} }\\right)$, то асимптотически почти наверное случайный граф \n{{является несвязным объединением изолированых рёбер и изолированых вершин.\n||содержит только изолированные вершины и вершины степени $1$ и $2$.}} Проверьте, что при вероятности $p$, удовлетворяющей условию $p\\cdot n^{ {{ \\frac{3}{2}||\\frac{4}{3} }} } \\to+\\infty$, в графе $G(n,p)$ асимптотически почти наверное есть вершина степени ${{2||3}}$ или выше. ',1050,NULL,'2016-04-14 19:11:56','',NULL,'91',NULL),(220,NULL,'Напомним, что в доказательстве теоремы Кэли на произвольной конечной группе $G$ вводится отображение $f_a(x)=a+x$, где $a$ --- произвольный элемент группы $G$. Доказывается, что это отображение является перестановкой элементов группы $G$. Неподвижной точкой отображения $f_a(x)$ называется элемент $x_0\\in G$ такой, что $f_a(x_0)=x_0.$ Сколько неподвижных точек может быть у этого отображения? Найдите количество перестановок $n=|G|$ элементов, которые имеют столько же неподвижных точек.',1050,NULL,'2016-04-07 11:08:33','',NULL,'96',NULL),(221,NULL,'Перечислите все подгруппы группы $(\\mathbb{Z}_{ {{16||27||18||12}} },+)$. Чему они изоморфны? Докажите, что других подгрупп в этой группе нет.',1050,NULL,'2016-04-07 10:40:31','',NULL,'95',NULL),(222,NULL,'Для многочлена ${{x^4+2x^3+2x+2||x^4+x^3+x^2+1}}$ над полем $\\mathbb{Z}_3$ определите, является ли он неприводимым.',1049,NULL,'2016-04-05 13:09:35','',NULL,'97',NULL),(223,NULL,'С помощью алгоритма Евклида найдите наибольший общий делитель многочленов ${{4x^5+2x^3+4x^2, x^3+x+3||3x^5+3x^3+x^2+2x+1, 4x^3+x}}\\in\\mathbb{Z}_5[x]$.',1049,NULL,'2016-03-27 20:35:51','',NULL,'97',NULL),(224,NULL,'Найдите неприводимый многочлен $Q$ степени $3$ над полем $\\mathbb{Z}_3$ и вычислите обратный элемент по умножению для ${{x+2||2x+1}}\\in\\mathbb{Z}_3[x]/(Q)$.',1049,NULL,'2016-04-07 10:41:37','',NULL,'97',NULL),(225,NULL,'Допустим, мы хотим доказать, что $R(s,t)\\ge n$. Что нам для этого нужно сделать?\n\\begin{shuffledlist}\n\\item Предъявить (или доказать его существование) граф на $(n+1)$ вершинах, в котором есть независимое множество (хотя бы одно) размера $s$ и клика (хотя бы одна) размера $t$.\n\\item Предъявить (или доказать его существование) граф на $n$ вершинах, в котором есть независимое множество (хотя бы одно) размера $s$ и клика (хотя бы одна) размера $t$.\n\\item Предъявить (или доказать его существование) граф на $(n−1)$ вершинах, в котором нет независимых множеств размера $s$ или нет клик размера $t$.\n\\item Предъявить (или доказать его существование) граф на $(n−1)$ вершинах, в котором нет ни независимых множеств размера $s$, ни клик размера $t$.\n\\item Предъявить (или доказать его существование) граф на $(n+1)$ вершинах, в котором есть независимое множество (хотя бы одно) размера $s$ или клика (хотя бы одна) размера $t$.\n\\item Предъявить (или доказать его существование) граф на $n$ вершинах, в котором нет независимых множеств размера $s$ или нет клик размера $t$.\n\\item Предъявить (или доказать его существование) граф на $n$ вершинах, в котором нет независимых множеств размера $(s+1)$ или нет клик размера $(t+1)$.\n\\item Предъявить (или доказать его существование) граф на $n$ вершинах, в котором нет ни независимых множеств размера $s$, ни клик размера $t$.\n\\end{shuffledlist}',1050,NULL,'2016-04-05 10:02:16','',NULL,'98',NULL),(226,NULL,'Рассмотрим произвольное натуральное число $m\n\\ge 2$. Докажите, что множество элементов \\[H=\\{x\\in \\mathbb{Z}_{m}:\\:\\exists k\\in\\mathbb{N}, \\text{ такое, что } x^k=0\\}\\] является подгруппой группы по сложению $\\mathbb{Z}_m$. Приведите пример модуля $m$, для которого эта подгруппа нетривиальна. Докажите, что, если $m$ --- простое число, то $H=\\{0\\}.$',1050,NULL,'2016-04-07 20:00:26','',NULL,'95',NULL),(227,NULL,'Рассмотрим произвольное натуральное число $m \\geqslant 2$. Пусть в группе $\\bbZ_m$ есть элемент $x\\notin\\{0,1\\}$ такой, что $x^2=x$. Докажите, что $m$ не может быть простым. Докажите, что множество \\[H=\\{xa:\\: a\\in\\bbZ_m\\}\\]\nявляется подгруппой по сложению. Может ли она быть тривиальной? Может ли $H$ содержать обратимые по умножению элементы?',1050,NULL,'2016-04-07 20:00:10','226',NULL,'95',NULL),(228,NULL,'Расмотрим произвольное конечное непустое подмножество $A\\subset\\mathbb{R}$ такое, что $|A+A|<c|A|$ для некоторой константы $c>1$. Для некоторых натуральных $k$ и $l$ обозначим \\[kA-lA=\\underbrace{A+A+\\ldots+A}_{k\\mbox{ раз}}-\\underbrace{A-A-\\ldots-A}_{l\\mbox{ раз}}.\\]\nДокажите, что тогда для любых двух натуральных чисел $m\\ge 3,$ $n\\ge 0$ верно неравенство $|mA-nA|<c^{2(m+n-2)}|A|.$',1050,NULL,'2016-04-14 10:07:51','',NULL,'99',NULL),(229,NULL,'Даны два произвольных конечных непустых подмножества $A,B\\in\\mathbb{R}$. Докажите, что, равенство $|A+B|=|A|+|B|-1$ выполняется тогда и только тогда, когда $A$ и $B$ являются арифметическими прогресиями с одинаковой разностью.',1050,NULL,'2016-04-14 10:12:50','',NULL,'99',NULL),(230,NULL,'Рассмотрим произвольное натуральное число $k\\ge 1.$ Назовём конечное множество $X\\subset\\mathbb{R}$ $k$-мерной арифметической прогрессией, если найдутся натуральные числа $L_1,L_2,\\ldots,L_k\\ge 1$ и числа $a_0,a_1,a_2,\\ldots,a_k\\in\\mathbb{R}$ такие, что \\[X=\\{a_0+a_1l_1+a_2l_2+\\ldots+a_kl_k:0\\le l_i\\le L_i-1, i=1,2,\\ldots,k\\}.\\]\nВозьмём произвольную $k$-мерную арифметическую прогрессию $P$. Для некоторых натуральных $m\\ge 1$ и $n\\ge 1$ обозначим \\[kP-lP=\\underbrace{P+P+\\ldots+P}_{m\\mbox{ раз}}-\\underbrace{P-P-\\ldots-P}_{n\\mbox{ раз}}.\\]\nДокажите, что $|mP-nP|<(m+n)^k|P|.$ ',1050,NULL,'2016-04-14 10:34:09','',NULL,'',NULL),(231,NULL,'Рассмотрим произвольные непустые подмножества $A,B\\subset\\mathbb{Z}_p.$ Для произвольного элемента $\\xi\\in\\mathbb{Z}_p\\setminus\\{0\\}$ обозначим \\[A+\\xi B=\\{a+\\xi b: a\\in A, b\\in B\\}.\\]\nТакже определим множество\n\\[Q[A,B]=\\left\\{\\frac{a_1-a_2}{b_1-b_2}: a_1,a_2\\in A, b_1,b_2\\in B, b_1\\neq b_2\\right\\}\\]\n(все операции, включая деление, производятся по модулю $p$). Докажите, что $|A+\\xi B|=|A||B|$ тогда и только тогда, когда $\\xi\\notin Q[A,B]$. Выведите из этого, что при $|A||B|>p$ верно $Q[A,B]=\\mathbb{Z}_p.$',1050,NULL,'2016-04-14 10:47:28','',NULL,'99',NULL),(232,NULL,'Часть 1. Отметьте все верные утверждения о числе скрещиваний. (Hint: предполагается, что эту задачу Вы прорешали на Stepic и время на её решение на контрольной $\\approx 0$.)\r\n\\begin{shuffledlist}\r\n\\item Число скрещиваний несвязного графа равно максимуму из чисел скрещиваний отдельных компонент связности.\r\n\\item Если $\\mathrm{cr}\\,G=0$, то $\\chi(G)\\le 5$.\r\n\\item Если $\\mathrm{cr}\\,G=1$, то из графа $G$ можно удалить ребро, так, что новый граф будет планарным.\r\n\\item $\\mathrm{cr}\\,K_4=1$.\r\n\\item $\\mathrm{cr}\\,K_n=n$.\r\n\\end{shuffledlist}\r\n\r\nЧасть 2. Рассмотрим такое изображение полного двудольного графа $K_{n,n}$: вершины расположим на двух параллельных прямых на равном расстоянии друг от друга, а рёбра будем изображать отрезками прямых линий (так мы обычно изображаем, например, граф $K_{3,3}$). Сколько при таком способе будет скрещиваний рёбер?',1,NULL,'2016-04-14 21:35:55','',NULL,'98',NULL);
